      "desc": "WizardAmigos CodeCamp is an open, collaborative, and free DIY programming school from Berlin, now starting in Taipei. People of all skill levels and backgrounds are welcome to join and learn together :-)<br><br>Are you:<br>\u2022 complete computer beginner?<br>\u2022 already curious about programming JavaScript?<br>\u2022 already a developer?<br><br>How does it work?<br>\u2022 join us at DigiQuarters (near Dongmen MRT station)<br>\u2022 bring your laptop and a pair of headphones<br>\u2022 we make a short introduction and then sit around the table to learn together<br><br>After you finish the course, you will be able to:<br>\u2022 continue to build your portfolio of apps (web or mobile)<br>\u2022 work on client projects<br>\u2022 find a job<br><br>We will help you with that!<br><br>In our community of learners we stay connected using<br><br>github<br><br>and<br><br>twitter<br><br>Feel free to Join us:<br><br>http://gitter.im/codingamigos/learners<br><br>Who are we?<br>People from different professional backgrounds (e.g. translators, scientists, journalists, designers, students, backend developers - to name only a few) who want to learn JavaScript... practically anyone from complete beginners to folks with jobs in the industry. It's a great opportunity to meet like minded people, to co-learn, help each other or just build new connections.<br><br>We believe programming is the literacy of the future and we curate our own curriculum and make use of many existing online learning resources to bring coding to as many people as possible :-)<br><br>The current state of our curriculum:http://wizardamigos.com<br><br>Our goal is to stay close to the cutting edge of how to develop in JavaScript and utilizing http://npmjs.org (http://npmjs.org/) and a hyper modular style of programming, so that building apps becomes like plugging together legos :-)<br><br>If this is unfamiliar to you, maybe go and watch this talk:<br><br>https://opbeat.com/community/posts/hypermodular-development-by-mathias-buus/<br><br>----------------------------------------------------------------------------<br><br>FEATURES:<br>\u2022 Free hands-on JavaScript study group<br>\u2022 Opportunity to practice English<br>\u2022 advanced coders are encouraged to mentor & contribute to the curriculum<br><br>REQUIREMENTS:<br>\u2022 be nice to people<br>\u2022 bring a laptop<br>\u2022 bring headphones<br>\u2022 (optional) bring a friend :-)<br><br>CURRENT LOCATION (https://www.google.com/maps/place/Lane+143,+Section+1,+Hangzhou+S+Rd,+Zhongzheng+District,+Taipei+City,+Taiwan+100/@25.038893,121.529824,15z/data=!4m5!3m4!1s0x3442a978045bcea5:0xb7c932a913c5fde7!8m2!3d25.0359576!4d121.5256393?hl=en-US): Taipei DigiQuarters ( http://www.digiquarters.com/ )<br>Lane 143, Section 1, Hangzhou S Rd, Zhongzheng District<br>Taipei City, Taiwan 100 (MRT Dongmen Station Exit 1)<br>\u2022 AC & WIFI (260 Mbps down, 230 Mbps up)<br>\u2022 Unlimited free coffee supply<br>\u2022 glass walls to write on with markers<br><br>USUAL SCHEDULE: (7:00pm ~ 11:00pm)<br>\u2022 We start with a short round of introduction<br>\u2022 and then jump right into hands-on exercises from our curriculum<br><br>You start at the beginning or what feels appropriate to you and each time continue where you left of. We encourage everyone to do home works to progress faster. Everyone has their own pace and that's encouraged. We also encourage to help each other out - during the meetup and on the chat :-)",
