      "duration": "PT4H30M",
      "photoAlbum": null,
      "desc": "WizardAmigos CodeCamp is an open, collaborative, and free DIY programming school from Berlin, now starting in Taipei. People of all skill levels and backgrounds are welcome to join and learn together :-)<br><br>Are you:<br>\u2022 complete computer beginner?<br>\u2022 already curious about programming JavaScript?<br>\u2022 already a developer?<br><br>How does it work?<br>\u2022 join us<br>\u2022 bring your laptop and a pair of headphones<br>\u2022 we make a short introduction and then sit around the table to learn together<br><br>After you finish the course, you will be able to:<br>\u2022 continue to build your portfolio of apps (web or mobile)<br>\u2022 work on client projects<br>\u2022 build your startup<br>\u2022 find a job<br><br>We will help you with that!<br><br>In our community of learners we stay connected using<br><br>github<br><br>and<br><br>twitter<br><br>Feel free to Join us:<br><br>http://gitter.im/codingamigos/learners<br><br>Who are we?<br>People from different professional backgrounds (e.g. translators, scientists, journalists, designers, students, backend developers - to name only a few) who want to learn JavaScript... practically anyone from complete beginners to folks with jobs in the industry. It's a great opportunity to meet like minded people, to co-learn, help each other or just build new connections.<br><br>We believe programming is the literacy of the future and we curate our own curriculum and make use of many existing online learning resources to bring coding to as many people as possible :-)<br><br>The current state of our curriculum:http://wizardamigos.com<br><br>Our goal is to stay close to the cutting edge of how to develop in JavaScript and utilizing http://npmjs.org (http://npmjs.org/) and a hyper modular style of programming, so that building apps becomes like plugging together legos :-)<br><br>If this is unfamiliar to you, maybe go and watch this talk:<br><br>https://opbeat.com/community/posts/hypermodular-development-by-mathias-buus/<br><br>----------------------------------------------------------------------------<br><br>FEATURES:<br>\u2022 Free hands-on JavaScript study group<br>\u2022 Opportunity to practice English<br>\u2022 advanced coders are encouraged to mentor & contribute to the curriculum<br><br>REQUIREMENTS:<br>\u2022 be nice to people<br>\u2022 bring a laptop<br>\u2022 bring headphones<br><br>USUAL SCHEDULE: (7:00pm ~ 11:00pm)<br>\u2022 We start with a short round of introduction<br>\u2022 and then jump right into hands-on exercises from our curriculum<br><br>You start at the beginning or what feels appropriate to you and each time continue where you left of. We encourage everyone to do home works to progress faster. Everyone has their own pace and that's encouraged. We also encourage to help each other out - during the meetup and on the chat :-)",
