      "desc": "The CodingAmigos are a loose bunch of coders, activists, creators and anything in between. The meetup is less of a formal meeting, more like a hangout to get to know interesting people, work on your own projects and chat about tech and the world.<br><br>\u2022 1. We follow the berlin code of conduct (http://berlincodeofconduct.org/)<br><br>\u2022 2. In order not to exclude anyone, english or code are the mandatory languages :)<br><br>\u2022 3. We aim to support each other<br><br>\u2022 4. We try to encourage equal amount of sharing and talking in our meetups<br><br>\u2022 5. Everyone tries to help shy people get introduced to others and to include everyone in the conversations<br><br>\u2022 6. We promote inclusiveness no matter what gender, age, knowledge level or any other background a person is<br><br>\u2022 7. Everyone tries to be a person who makes other people around her/him feel nice<br><br>Get to know us, and chat:<br><br>\u2022 https://gitter.im/codingamigos/chat<br><br>Show off what you're working on:<br><br>\u2022 http://codingamigos.com/<br><br>Collaborate with the RefugeesWork project, supporting newcomers and learners<br><br>\u2022 http://refugeeswork.com (http://www.refugeeswork.com/)<br><br>If you already visited us a few times and feel like hosting the event, let us know and we will help you get started.",
