      "desc": "WizardAmigos CodeCamp is an open, collaborative, and free DIY programming school from Berlin, now starting in Phuket. People of all skill levels and backgrounds are welcome to join and learn together :-)<br><br>Are you:<br>\u2022 complete computer beginner?<br>\u2022 already curious about programming JavaScript?<br>\u2022 already a developer?<br><br>How does it work?<br>\u2022 join us<br>\u2022 bring your laptop and a pair of headphones<br>\u2022 we make a short introduction and then sit around the table to learn together<br><br>After you finish the course, you will be able to:<br>\u2022 continue to build your portfolio of apps (web or mobile)<br>\u2022 work on client projects<br>\u2022 build your startup<br>\u2022 find a job<br><br>We will help you with that!<br><br>In our community of learners we stay connected using<br><br>gitter<br>https://gitter.im/wizardamigosinstitute/program<br><br>and<br><br>facebook https://www.facebook.com/groups/369246343421803/<br><br>Feel free to Join us:<br>http://app.wizardamigos.com<br><br>----------------------------------------------------------------------------<br><br>FEATURES:<br>\u2022 Free hands-on JavaScript study group<br>\u2022 Opportunity to practice English<br>\u2022 advanced coders are encouraged to mentor & contribute to the curriculum REQUIREMENTS:<br>\u2022 be nice to people<br>\u2022 bring a laptop<br>\u2022 bring headphones<br><br>USUAL SCHEDULE: (7:00pm ~ 10:00pm)<br>\u2022 We start with a short round of introduction<br>\u2022 and then jump right into hands-on exercises from our curriculum You start at the beginning or what feels appropriate to you and each time continue where you left of. We encourage everyone to do home works to progress faster. Everyone has their own pace and that's encouraged. We also encourage to help each other out - during the meetup and on the chat :-)",
