      "desc": "V ponedeljek, 6.marca, smo pri\u010deli z WizardAmigos Codecamp Zasavje, skupinskim u\u010denjem (co-learning) programskega jezika Java Script. Z uporabo spletne platforme bomo \u010disti za\u010detniki, poznavalci in pa \u010disto naklju\u010dni entuziasti zavihali rokave in izzvali mo\u017eganje. Nov jezik? Programski jezik!<br><br>U\u010dimo se skupaj, a vsak po svoji poti.<br>Kaj potrebuje\u0161?<br>- prenosnik<br>- slu\u0161alke<br><br>Cena?<br>Neprecenljivo. Pridru\u017ei se!<br><br>Mimogrede - ste \u017ee kdaj sli\u0161ali za brezposelnega programerja? Ali pa da je danes na trgu dela programiranje \u0161kodljiva ve\u0161\u010dina? Mi tudi ne. ///////////////////////////////////////////////////////////////////////////////////////<br><br>WizardAmigos CodeCamp is an open, collaborative, and free DIY programming school from Berlin, now starting in Zasavje, Slovenia. People of all skill levels and backgrounds are welcome to join and learn together :-)<br><br>Are you:<br>\u2022 complete computer beginner?<br>\u2022 already curious about programming JavaScript?<br>\u2022 already a developer?<br><br>How does it work?<br>\u2022 join us<br>\u2022 bring your laptop and a pair of headphones<br>\u2022 we make a short introduction and then sit around the table to learn together<br><br>After you finish the course, you will be able to:<br>\u2022 continue to build your portfolio of apps (web or mobile)<br>\u2022 work on client projects<br>\u2022 build your startup<br>\u2022 find a job<br><br>We will help you with that!<br><br>In our community of learners we stay connected using<br>Gitter chat and Facebook.<br>Feel free to Join us:<br>https://www.facebook.com/groups/369246343421803/<br>https://gitter.im/wizardamigosinstitute/program<br><br>http://npmjs.org and a hyper modular style of programming, so that building apps becomes like plugging together legos :-)https://opbeat.com/community/posts/hypermodular-development-by-mathias-buus/<br><br>----------------------------------------------------------------------------<br><br>FEATURES:<br>\u2022 Free hands-on JavaScript study group<br>\u2022 Opportunity to practice English<br>\u2022 advanced coders are encouraged to mentor & contribute to the curriculum REQUIREMENTS:<br>\u2022 be nice to people<br>\u2022 bring a laptop<br>\u2022 bring headphones<br><br>USUAL SCHEDULE: (7:00pm ~ 11:00pm)<br>\u2022 We start with a short round of introduction<br>\u2022 and then jump right into hands-on exercises from our curriculum You start at the beginning or what feels appropriate to you and each time continue where you left of. We encourage everyone to do home works to progress faster. Everyone has their own pace and that's encouraged. We also encourage to help each other out - during the meetup and on the chat :-)",
