      "desc": "The CodingAmigos are a loose bunch of coders, activists, creators and anything in between. The meetup is less of a formal meeting, more like a hangout to get to know interesting people, work on your own projects and chat about tech and the world.<br><br>We follow the Berlin Code of Conduct (http://berlincodeofconduct.org/) In order not to exclude anyone, English or code are the mandatory languages :) We aim to support each other We try to encourage equal amount of sharing and talking in our meetups Everyone tries to help shy people get introduced to others and to include everyone in the conversations We promote inclusiveness no matter what gender, age, knowledge level or any other background a person is Everyone tries to be a person who makes other people around her/him feel nice Get to know us, and chat:<br>https://gitter.im/codingamigos/chat (https://gitter.im/codingamigos/chat) Show off what you're working on:<br>http://codingamigos.com/ (http://codingamigos.com/) Collaborate with the RefugeesWork project, supporting newcomers and learners<br>http://refugeeswork.com (http://www.refugeeswork.com/) If you already visited us a few times and feel like hosting the event, let us know and we will help you get started.",
