      "desc": "OCT 25 - NOV 24 2019<br>Details and tips: https://hackmd.io/oZ_RERTrTp2hBypEZ6E2tQ<br><br>SCHEDULE:<br>- we meet every day from around 2pm until 8pm in C.A.M.P. Library Cafe in Maya (Nimman)<br>- 2x a week we'll try to organize some lessons/lightning talks (depending on when mentors are available, will announce it)<br><br>COMMUNICATION:<br>- for communication we use Telegram and/or Gitter chat https://t.me/joinchat/CgTftxVXA-NuDYvJqgsJig<br>https://gitter.im/wizardamigosinstitute/program<br><br>HOW DOES IT WORK:<br>- learner/attendee should pick the topic of their interest and we'll try hard to help you find good learning resources and support you with your learning efforts. Everyone, including you can ask questions and try to answer questions of others on our gitter community chat.<br>- attendees make their own plan on what they want to learn/work on projects/meet with to collaborate on projects together<br><br>BENEFIT:<br>- you get a community of like minded people that also learn/work<br>- you get a time frame in which you can set yourself on a mission to learn something<br>- you can ask for help on a chat (people will be coming and going and as there is no strict structure, you should not depend on physically meet to be able to get started/continue with your work)<br>- @serapath (Alex) and @ninabreznik (Nina) will be here every day in approximately this time frame so we can help out, although we have work we need to do, so prepare for self directed learning<br><br>ABOUT:<br>- Wizard Amigos is a grass root community and operates with zero budget and on purely voluntary basis, so don't expect strict schedule<br>- everyone is welcome<br>- remote work demands a lot of self organization so this whole process also helps you learn how to gain that skill<br><br>ABSOLUTE BEGINNERS?<br>- if you are completely new to coding, don't worry, we have a list of resources to help you get started<br>- we recommend you: Javascript (for any kind of web development) or Solidity (if you are interested in Ethereum ecosystem and in building smart contracts)<br><br>C.A.M.P. Library Cafe (Maya mall, 5th floor)<br>- if you use AIS mobile internet, you can use the space for free (connect to AIS super wifi)<br>- if you don't use AIS, consider getting a monthly sim card and enjoy free space<br>- if you don't have AIS and don't plan to get it, you can buy a drink and get 2h free internet (2 cappuchinos are 150 THB and get you 6h of free internet) OR you can also connect to your mobile internet)",
