      "desc": "WizardAmigos CodeCamp is a FREE open source, open collaborative, and free DIY (Do it yourself) programming school from all over the world. It exists in other locations like Taiwan/Taipei, Germany/Berlin, USA/Nashville and now starting in Nigeria/Lagos. People of all skill levels and backgrounds are welcome to join and learn together :-)<br><br>What is it?<br>\u2022 Free hands-on JavaScript study group<br>\u2022 Opportunity to practice English<br>\u2022 advanced coders are encouraged to mentor & contribute to the curriculum<br><br>For whom is it?<br>\u2022 a complete computer beginner? yes, perfect :-)<br>\u2022 already curious about programming JavaScript? thats good too :-)<br>\u2022 already a developer? awesome, hope you like to help others too :-)<br><br>How does it work?<br>\u2022 be nice to people<br>\u2022 bring a laptop<br>\u2022 bring headphones (so you can focus while others might talk/discuss)<br>\u2022 We start with a short round of introduction if somebody is new<br>\u2022 and then jump right into hands-on exercises from our curriculum<br><br>more information: https://wizardamigos.com/chapter-lagos<br>gitter chat: https://gitter.im/wizardamigosinstitute/program<br>facebook: https://www.facebook.com/groups/369246343421803<br><br>You start at the beginning or what feels appropriate to you and each time continue where you left of. We encourage everyone to do home works to progress faster. Everyone has their own pace and that's encouraged. We also encourage to help each other out - during the meetup and on the chat :-)<br><br>After you finish the course, you will be able to:<br>\u2022 continue to build your portfolio of apps (web or mobile)<br>\u2022 work on client projects<br>\u2022 build your startup<br>\u2022 find paid work - we help with that<br><br>Contact organizers:<br>+234(0)80-3297-2057<br>+234(0)81-2620-3069",
